import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./CakeryApp/Pages/Home"
import Products from "./CakeryApp/Pages/Products"
import CustomizerPage from "./CakeryApp/Pages/CustomizerPage";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />

        {/* category route */}
        <Route path="/category/:slug" element={<Products />} />

        {/* product details / customizer */}
        <Route path="/product/:id" element={<CustomizerPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
